    this.$bus.$off('SYMBOL_LIST_ALL'); // 监听 WebSocket 链接成功

    this.$bus.$off('WEBSOCKET_ON_OPEN'); // 获取 当前选中的货币对

    this.$bus.$off('SYMBOL_CURRENT');
  },
  beforeDestroy: function beforeDestroy() {
    this.MywebSocket = false;
  },
  methods: {
    handlerClickChart: function handlerClickChart(value) {
      if (value === 'price') {
        // price chart
        this.switchChartType(1);
      } else {
        // deep chart
        this.switchChartType(2);
      }
    }
  }
};
